('home', 1, 18, 0, 1, 'Home', '<p><img class="img-right" src="_clientfiles/home/placeholder.jpeg" alt=" " /></p><h1>Welcome to Xindi</h1><p><strong>You have successfully installed Xindi!</strong></p><p>This is the public facing site which is fully customisable.</p><p><a href="./admin" target="_blank">You can access the content management system here</a>. The default email address and password are &#39;admin@getxindi.com&#39; and &#39;password&#39;.</p><p>If you need support you can:</p><ul><li><a href="https://github.com/simonbingham/xindi">View our Wiki and Issue Tracker</a></li><li><a href="https://groups.google.com/forum/?hl=en&amp;fromgroups#!forum/getxindi">Post to our Google Group</a></li></ul><p>To keep up to date with the latest Xindi news:</p><ul><li><a href="http://www.getxindi.com/">Visit the Xindi website</a></li><li><a href="https://twitter.com/#!/getxindi">Follow Xindi on Twitter</a></li><li><a href="http://www.facebook.com/getxindi">Find Xindi on Facebook</a></li><li><a href="https://plus.google.com/112798469896267857099/posts">Find Xindi on Google+</a></li></ul><p>I very much welcome contributions to Xindi. If you would like to contribute some code please <a href="http://github.com/simonbingham/xindi">fork the project on GitHub, modify the code and send me a pull request</a>.</p><p>I hope you enjoy using Xindi.</p><p><a href="https://twitter.com/simonbingham">Simon Bingham</a></p>', 1, 'Home', 'Welcome to Xindi You have successfully installed Xindi! This is the public facing site which is fully customisable. You can access the content management system here . The default email address and pa', 'need,using,send,pull,password,Group,Issue,please,would,Google+,Follow,Wiki,request,GitHub,welcome,fully,contributions,fork,support,Find,here,code,like,Facebook,Visit,much,content,customisable,project,', '20130501', '2013-04-10 20:22:30', 'Default User'),
